import React, { useState } from "react";
import "./Style.css";
import Cardsdata from "./CartData";
import { Button } from "react-bootstrap";
import { Card } from "react-bootstrap";
const Home = () => {
  const [cartData, setCartData] = useState(Cardsdata);
  return (
    <>
      <section className="iteam_section mt-4 container">
        <h2 className="px-4" style={{ fontWeight: 400 }}>
          Restaurants in Delhi Open now
        </h2>
        <div className="row mt-2 d-flex justify-content-around align-items-center">
          <Card
            style={{ width: "22rem", border: "none" }}
            className="hove mb-4"
          >
            <Card.Img src="/logo192.png" variant="top" className="cd" />

            <div className="card_body">
              <div className="upper_data d-flex justify-content-between align-items-center">
                <h4 className="mt-2">Punjabi</h4>
                <span>4&nbsp;★</span>
              </div>
              <div className="lower_data d-flex justify-content-between ">
                <h5>Karol Bagh</h5>
                <span>₹ 220</span>
              </div>
              <div className="extra"></div>
              <div className="last_data d-flex justify-content-between align-items-center">
                <img src="/logo192.png" className="limg" alt="" />
                <Button
                  style={{
                    width: "150px",
                    background: "#ff3054db",
                    border: "none",
                  }}
                  variant="outline-light"
                  className="mt-2 mb-2"
                  //onClick={()=>send(element)}
                >
                  Add TO Cart
                </Button>
                <img src="/logo192.png" className="laimg" alt="" />
              </div>
            </div>
          </Card>
        </div>
      </section>
    </>
  );
};

export default Home;
